    def dep_transform(self, dep):
        # h, w = dep.shape
        # left = int(round((w - h) / 2.0))
        # right = left + h
        # dep = dep[:, left:right]
        dep = torch.Tensor(dep[None,None,:,:]).float()
        dep = torch.nn.functional.interpolate(dep, (self.image_dim[0], self.image_dim[1]))[0]
        return dep

